INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 131601, 1, 131601, 0, 0, 131601, 399, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 450, 0, 1.92, 4, 4, 0, 131601, 0, 0, 0, "2025/01/09 12:00:00", "りり", "2025/01/15 14:59:59", "リリ（サマー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 131701, 2, 131701, 0, 0, 131701, 743, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 450, 0, 1.92, 44, 53, 0, 131701, 0, 0, 0, "2025/02/10 12:00:00", "あめす", "2025/02/15 14:59:59", "アメス（サマー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 3, 131801, 2, 131801, 0, 0, 131801, 709, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 450, 0, 2.09, 7, 21, 0, 131801, 0, 0, 0, "2024/08/15 15:00:00", "ほまれ", "2030/12/31 15:00:00", "ホマレ（サマー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 1, 131901, 2, 131901, 0, 0, 131901, 725, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 450, 0, 2.09, 7, 23, 0, 131901, 1, 0, 0, "2024/08/31 12:00:00", "えみりあ", "2030/12/31 15:00:00", "エミリア（サマー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 132001, 2, 132001, 0, 0, 132001, 775, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 450, 0, 2.09, 7, 21, 0, 132001, 0, 0, 0, "2024/09/13 12:00:00", "えきどな", "2024/09/25 11:59:59", "エキドナ（サマー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 132101, 1, 132101, 0, 0, 132101, 146, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 450, 0, 2.09, 13, 24, 0, 132101, 0, 0, 0, "2024/08/31 12:00:00", "れむ", "2024/09/13 11:59:59", "レム（サマー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 132201, 2, 132201, 0, 0, 132201, 721, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 450, 0, 1.84, 7, 7, 0, 132201, 0, 0, 0, "2024/09/30 12:00:00", "のぞみ", "2024/10/10 11:59:59", "ノゾミ（アルケミスト）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 132801, 2, 132801, 0, 0, 132801, 750, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 450, 0, 2.09, 7, 0, 0, 132801, 0, 0, 0, "2024/11/30 12:00:00", "らいらえる", "2024/12/09 11:59:59", "ライラエル（クリスマス）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 3, 132901, 2, 132901, 0, 0, 132901, 748, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 450, 0, 2.09, 5, 46, 0, 132901, 0, 0, 0, "2024/12/09 12:00:00", "いお", "2030/12/31 15:00:00", "イオ（クリスマス）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 133001, 1, 133001, 0, 0, 133001, 234, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 450, 0, 2.09, 0, 0, 0, 133001, 0, 0, 0, "2024/12/31 12:00:00", "ぐれいす", "2025/01/03 18:59:59", "グレイス");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 1, 133201, 1, 133201, 0, 0, 133201, 296, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 450, 0, 2.09, 4, 22, 0, 133201, 1, 0, 0, "2024/12/31 12:00:00", "もにか", "2030/12/31 15:00:00", "モニカ（ニューイヤー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 133501, 2, 133501, 0, 0, 133501, 718, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 450, 0, 2.09, 4, 22, 0, 133501, 0, 0, 0, "2025/01/03 19:00:00", "されん", "2025/01/15 14:59:59", "サレン（ニューイヤー）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 133601, 1, 133601, 0, 0, 133601, 445, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 450, 0, 2.09, 0, 0, 0, 133601, 0, 0, 0, "2025/01/20 12:00:00", "めどぅーさ", "2025/01/31 11:59:59", "メドゥーサ");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 133701, 2, 133701, 0, 0, 133701, 717, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 450, 0, 2.09, 8, 0, 0, 133701, 0, 0, 0, "2025/01/31 12:00:00", "らびりすた", "2025/02/10 11:59:59", "ラビリスタ（アルファ）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 133901, 1, 133901, 0, 0, 133901, 228, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 450, 0, 2.09, 6, 0, 0, 133901, 0, 0, 0, "2025/02/10 12:00:00", "くりすてぃーな", "2025/02/20 11:59:59", "クリスティーナ（アルファ）");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 3, 134101, 0, 134101, 0, 0, 0, 0, "", 0, 0, 0.0, 5, 1, 0, 0, 0, 0, 0, "2015/04/01 15:00:00", "ふぶき", "2030/12/31 15:00:00", "フブキ");
